import styled from 'styled-components';

export const Input = styled.input`
  padding: 10px;
  border: 1px solid #ccc;
  border-radius: 10px;
  font-size: 16px;
  outline: none;
  width: 300px;
  align-content: center;
  text-align: center;
`;
